import React from 'react';
import { makeStyles } from "@material-ui/core/styles";
import { ReactComponent as Home } from "assets/icon/home.svg";
import { SvgIcon } from '@material-ui/core';

const useStyles = makeStyles({
    // #FFAC62
    // #1E6F79
    container: {
        height: '100vh',
        backgroundColor: '#1E6F79'
    },
    titleContainer: {
        display: 'flex',
        paddingTop: '5vh',
        height: '10vh',
        alignItems: 'center',
        justifyContent: 'center',
        color: '#FFAC62',
    },
    address:{
        position: 'absolute',
        marginTop:'40vh',
        height: '10vh',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
    },
    homeIcon:{
        fontSize: '100px',
    }
});

export default function SectionPatreon(props) {
    const classes = useStyles();
    return (
        <div className={classes.container}>
            <div className={classes.titleContainer}>
                <h1 style={{ fontWeight: 'bold', fontSize: '12vh', paddingTop: '5vh'}}>YOU CAN CONTACT US AT</h1>
            </div>
                <SvgIcon component={Home} className={classes.homeIcon}></SvgIcon>
        </div>
    );
}
